webpackJsonp([0xaff4cb3094e5],{"./node_modules/json-loader/index.js!./.cache/json/zemlyakov.json":function(e,n){e.exports={data:{site:{siteMetadata:{title:"Саентология Тома Круза",author:"Том Круз"}},markdownRemark:{id:"/home/gleki/ccc/src/pages/2016-05-23-zemlyakov/index.md absPath of file >>> MarkdownRemark",html:'<p>Александр Земляков - одитор (консультант) украинского происхождения.</p>\n<p>Система, которую он предлагает, согласно мнению Церкви Саентологии является еретической (так называемый сквиреллинг).</p>\n<p>И действительно, по слухам, его услуги куда дешевле предлагаемых “официальной” церковью.</p>\n<p>По факту, методы, предлагаемые Александром Земляковым, мало чем отличаются от стандартной технологии Хаббарда.</p>\n<ol>\n<li>\n<p>Земляков не пытается убедить людей в том, что они смогут летать, лечить людей на расстоянии и поджигать взглядом бочки с керосином. Вместо этого способности, раскрываемые в процессе одитинга (духовного очищения) - вполне обычные, например, “человек по каким-то внутренним психологическим причинам не может уехать в другой город”.</p>\n</li>\n<li>\n<p>Многие методики можно применять самостоятельно. Они вполне безопасны и таким образом вы можете начать их применять бесплатно хоть сейчас.</p>\n</li>\n</ol>\n<p>Честность и бесплатность вызывают уважение. Конечно, Александр Земляков предлагает и платные услуги, что вполне очевидно для практикующего психоаналитика.</p>\n<p>По самому видео вы можете судить, является ли автор видео всемогущим тэтаном или же это просто психологическая помощь или же это средство саморазвития.</p>\n<p>Приведём ссылки на видео.</p>\n<p>Внимание! Мы не рекомендуем применять методики, описанные в видео, и отдавать своё имущество саентологам.</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <html><head></head><body><iframe src="https://www.youtube.com/embed/3nO3tXuicFM?list=PLTDPbnTZJqlLTjZuV1NwlUat-QttVRZ5j" frameborder="0" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe></body></html>\n          </div>\n          </div>',frontmatter:{title:"Что это за очищение по Александру Землякову?",date:"2016-04-23"}}},pathContext:{path:"/zemlyakov/"}}}});
